import React , {Component} from 'react'
import axios from 'axios';

class Blog extends Component{
    state = {
        users : []
    }
    componentDidMount(){
        console.log(this.props.match.path)
        axios.get('https://jsonplaceholder.typicode.com/users').then(res => {
            this.setState({
                users : res.data
            })
        });
    }

    
    render(){
        const func = this.state.users.map(line => {
            return(
                <li key={line.id}>Name : {line.name}<br/>username : {line.username}</li>
            );
        })

        return(
            <div>
                <h2>Blog</h2>
                <p>This section from Blog</p>
                <div>
                    <ul className='ul-blog'>
                        {func}
                    </ul>
                </div>
            </div>
        );
    }
}

export default Blog;
